import React from 'react';
import PageWrapper from '../components/PageWrapper';
import Nav from '../components/Nav';
import Body from '../components/Body';

export default function LunchMenu() {
	return (
		<PageWrapper>
			<Nav />
			<Body>
				<>
					<dt>
						<section>
							<h4>Måndag:</h4>
							<li>CLOSED</li>
						</section>
					</dt>

					<label>Tisdag:</label>
					<ol>
						<li>Masaman Curry med Kyckling,jordnötter, Ris ★★ </li>
						<li>Äggnudlar med Biff </li>
						<li>Sötsur Wok med Fläskfilé, Ris ★ </li>
						<li>
							Tre Små Rätter <strong>95:-</strong>
						</li>
						<li>Vegetarisk( Tofu, Cashewnötter ), Ris </li>
					</ol>

					<dt>Onsdag:</dt>
					<ol>
						<li>Panang Curry med Kyckling,jordnötter, Ris ★★</li>
						<li>Bambuskott med Biff, Ris </li>
						<li>Friterade Kycklingfilé med Sötsursås, Ris </li>
						<li>
							Tre Små Rätter <strong>95:-</strong>
						</li>
						<li>Vegetarisk ( Tofu, Cashewnötter ), Ris </li>
					</ol>

					<dt>Torsdag:</dt>
					<ol>
						<li>Grön Curry med Kyckling, Ris ★★</li>
						<li>Äggnudlar med Biff </li>
						<li>Cashewnötter med Kyckling, Ris ★</li>
						<li>
							Tre Små Rätter <strong>95:-</strong>
						</li>
						<li>Vegetarisk( Tofu, Cashewnötter ), Ris </li>
					</ol>

					<dt>Fredag:</dt>
					<ol>
						<li>Röd Curry med Kyckling, Ris ★★</li>
						<li>Padd Thai med Biff, Citron, Jordnötter </li>
						<li>Friterade Fläskfilé med Sötsursås, Ris </li>
						<li>
							Tre Små Rätter <strong>95:-</strong>
						</li>
						<li>Vegetarisk( Tofu, Cashewnötter ), Ris </li>
					</ol>
				</>
			</Body>
			<style jsx>{`
				background: DarkSeaGreen;
				display: flex;
				flex-direction: column;
				margin: auto;
			`}</style>

			<style jsx>{`
				p {
					color: blue;
				}
				div {
					background: goldenrod;
				}
				@media (max-width: 600px) {
					div {
						background: blue;
					}
				}
			`}</style>
			<style global jsx>{`
				body {
					background: #fffff0;
				}
			`}</style>
		</PageWrapper>
	);
}
